INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3350030147983', 'Assortiment Asiatique', 'Beignets de crevettes : _crevettes_ 39 % (contient _sulfites_), eau, fécule de pomme de terre, farine de _blé_, huile de tournesol, poudres à lever : diphosphate disodique, carbonate acide de sodium, sel, amidon de _blé_, amidon transformé de pomme de terre, sucre, _œuf_ entier en poudre, curcuma, épaississants : carraghénanes, gomme de guar, gomme xanthane. Samossas bœuf : galette 34% (eau, farine de blé 35 %, blanc d’_œuf_ en poudre, huile de tournesol, sel, émulsifiant : lécithine de colza), oignon 28 %, viande de bœuf 27,3% (origine : France), carotte, concentré de tomate, huile de tournesol, curry 0,5% (contient moutarde), sel, poivre, piment. Mini nems porc : galette 44,4 % (eau, farine de riz, huile de tournesol, sel), viande de porc 15,2 % (origine : France), oignon 12,8 %, vermicelles de pois 9,1 %, carotte 6,1 %, protéine de _soja_, gras de porc 2,5 %, champignons noir, germes de haricot mungo, chapelure (contient _blé_), arôme (contient gluten), sel, caramel (sucre, eau, sirop de glucose-fructose), poivre. Sauce nuoc-mâm : eau, sucre, nuoc-mâm 14% (_poissons_, sel), vinaigre, sel. Sauce pour samossas : eau, sucre, concentré de tomate, vinaigre (contient conservateur : sulfite acide de sodium), amidon transformé de maïs, sel, colorant : caramel ordinaire, oignon, acidifiant : acide citrique, poivre, arômes. Sauce pour beignets de crevettes : eau, sucre, vinaigre, ananas, poivron, amidon transformé de maïs, huile de tournesol, sel, acidifiant : acide citrique, épices [curry (contient _moutarde_), gingembre], stabilisants : gomme de guar, gomme xanthane.', '', '19.7', '3.6', '43', '11.1', '', '12', '2.9', '1.14173228346457', '', '0');

