VALUES ('3350030147990', '4 Nems au Porc avec Sauce Nuoc-Mâm', 'NEM AU PORC 4 x 70 g : Galette de riz 39,5 % (eau, farine de riz 38 %, huile de tournesol, sel), viande de porc 16 %, oignon 14 %, vermicelle de pois réhydraté 9,9 % (haricot mungo, pois, eau), carotte 6,6 %, protéine de soja, gras de porc 2,7 %, champignon noir réhydraté, germe de haricot mungo, farine de blé, arôme (dont blé), sel, caramel (sirop de glucose-fructose, sucre, eau, acide citrique), poivre blanc. SAUCE NUOC-MÂM 20 g : eau, sucre, nuoc mâm 14 % (anchois, sel), vinaigre, sel.', 'https://static.openfoodfacts.org/images/products/335/003/014/7990/front.6.400.jpg', '12', '3.4', '20', '3.8', '2.4', '7', '1.25', '0.493', '', '0');

